	add("inflow", "{\"term\":\"inflow\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|in|flow|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of flowing in or int\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything which flows in or int\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027inflow\u0027\u0027 of air\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Influence\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Sandra Marie Schneiders, \u0027Finding the Treasure\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"But there is also \u0026quot;top down causality\u0026quot; in which the entire system, as a whole, is affected by the \u0027\u0027inflow\u0027\u0027 or influence of pattern formation, or \u0026quot;information.\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Richard Calichman, \u0027Overcoming Modernity\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Broadly speaking, there are two cases in which a national culture is subjected to the sudden \u0027\u0027inflow\u0027\u0027 or influence of a foreign culture: (1) when the former is conquered by the latter and (2) when it conquers the latter\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Gabriel Ezutah, \u0027Trail of Immortality\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Open yourself completely to the \u0027\u0027inflow\u0027\u0027 and influence of the music and light of God through daily practice of the spiritual exercises, which he gives to you\", \"priority\":10}]}, \"synonyms\":{}}");

