	add("infonaut", "{\"term\":\"infonaut\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|info|naut|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who navigates the information superhighway; an Internet user\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, :wikipedia:Howard Reingold, Howard, \u0027Tools for thought: the people and ideas behind the next computer revolution\u0027, [http://www.rheingold.com/texts/tft/11.html Chapter 11]. Computer Book Division/Simon \u0026amp; Schuster\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Because he started out young in a field that was young itself, [Alan] Kay was one of the first of the generation of \u0027\u0027infonauts\u0027\u0027, the ones who grew up with the tools created by the pioneers, and who have been using them to create a medium for the rest of us\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Carmen Luke Singh, [http://www.informaworld.com/smpp/content~db\u003dall~content\u003da746406775 ekastasis@cyberia]. \u0027Discourse: Studies in the Cultural Politics of Education\u0027, \u0027\u002717\u0027\u0027(2):187-20\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the networked teacher—the \u0027\u0027infonaut\u0027\u0027 charting a course with her students across the vast terrain of Internet communities, databases, and WWW sites—can connect with other teachers in on-line professional communities\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Allan Martin, Hannelore B Rader, \u0027Information and IT literacy: enabling learning in the 21st century‎\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Yet the central issue remains, would an Iranian \u0027\u0027infonaut\u0027\u0027 navigate like, say, an American one\", \"priority\":7}]}, \"synonyms\":{}}");

